import Cats from './views/AllCats';
import { Link, Navigate, Route, Routes} from 'react-router-dom';
// import GlobalStyle from './globalStyles';
// import  EditCat  from './views/EditCat';
// import Cat from './views/OneCat';
import { NewCat } from './views/NewCat';
import { NotFound } from './views/NotFound';


function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg sticky-top justify-content-around">

        <div className="navbar-nav justify-content-between w-10">
          <Link
              to="/cats"
              className="only-cats "
            >
              onlyCats
          </Link>
          <Link
              to="/cats/new"
              className="nav-link" >

                Add Cat
          </Link>

            <img src='favicon.ico' className='icons nav-icon nav-link'></img>

        </div>
      </nav>

  {/* FRONT END ROUTES to display VIEWS */}
  {/* SEPERATTE FROM SERVER ROUTES */}
  <Routes>
        {/* Redirect example */}
        <Route path="/" element={<Navigate to="/cats" />} />
        <Route path="/cats" element={<Cats />} />
        {/* <Route path="/cats/:id" element={<Cat />} />
        <Route path="/cats/:id/edit" element={<EditCat />} />*/}
        // <Route path="/cats/new" element={<NewCat />} /> 
        <Route path="*" element={<NotFound />} />
      </Routes>

    </div>
  );
}

export default App;
